import React from 'react'
import '../styles/cat.css'

function CatLoad() {
  return (
    <>
    <div>
      <div className='face'>
        <div className='muzzle'>
          <div className='eyeL'></div>
          <div className='eyeR'><div className='pupil'></div></div>
          <div className='nose'><div className='pupil'></div></div>
        </div>
      </div>
    </div>
    </>
  );
}

export default CatLoad;
